--------------------------------------------------\nOLIVAN NEVES RANGEL MACHADO[1668] - R. - <noc@vodanet-telecom.com> em 23/01/2012 19:04\nReparo realizado com sucesso, Link operante.\n--------------------------------------------------\nOLIVAN NEVES RANGEL MACHADO[1668] - R. - <noc@vodanet-telecom.com> em 23/01/2012 19:04\nAPRESENTOU UMA SOLUÇÃO para a ocorrência (vide campo Solução)', 3, 78, 24, 127, '', 0),
