(141, NULL, 'Atendimento iniciado por Olivan Machado as 14:43 de 25/01/2012\r\n\r\n_____________________________________________________________________________________\r\nem 25/01/2012 14:16 - Tentativa de contato tel (31) 3637-4695, sem sucesso.\r\nem 25/01/2012 14:23 - Tentativa de contato tel (31) 3637-4695, sem sucesso.\r\nem 25/01/2012 14:25 - Tentativa de contato tel (31) 3637-4695, sem sucesso.\r\nem 25/01/2012 14:27 - Tentativa de contato tel (31) 3637-4695, sem sucesso.\r\nem 25/01/2012 14:31 - Tentativa de contato tel (31) 3637-4695, sem sucesso.\r\nem 25/01/2012 14:34 - Tentativa de contato tel (31) 3637-4695, sem sucesso.\r\n\r\n # Foi enviado Técnico no local dia 24/01/2012 e  não foi encontrado nenhuma pessoa na localidade.\r\n\r\n # Feito contato com Secretaria da Saúde tel.(31) 87032418 para informar sobre a localidade, maicon (responsável técnico da SES) ficou de retorna ligação para informa situação da localidade.\r\n\r\n # Maicon entrou em contato com a vodanet informando que as localidades SES-SAIA-0750  SES-SAIA-0754 estão fechadas atualmente. O mesmo informa ainda que entrará em contato com a Prdemge para informar a situação.\r\n', 3, 12, 10, 137, 'Maicon entrou em contato com a vodanet informando que as localidades SES-SAIA-0750  SES-SAIA-0754 estão fechadas atualmente. O mesmo informa ainda que entrará em contato com a Prdemge para informar a situação.\r\n--------------------------------------------------\r\nPRODEMGE RESPONDEU NO AGILIS\r\n\r\nOs clusters 0750 e 0754 foram colocados em manutenção programada até 10/02/2012.\r\n\r\n', 2),
