(148, '2012-01-30 12:41:21', ' # atendimento Iniciado Por Olivan Neves\r\n \r\n 0751 \r\n\r\n As 08:00 foi feito contato com Mara onde foi informado que o modem se encontra somente com a Luz Power acessa, foi feito o desligamento no modem na tomada de energia mas link não ficou On\r\n \r\n Foi passado a situação para Hernan onde foi acionado tecnico airton para o local.\r\n \r\n - Airton informou que a base da antena danificada, foi colocada no local, mas a base ainda se encontra danificada, os conectores não estão Isolados e os parafusos do azimute não estão presos causando desalinhamento por qualquer toque na antena. Airton deixou o local com link  ON.\r\n\r\n - Hernan ficou de Marca com a lider para está consertandado  a Base da antena.\r\nl\r\n 0743 \r\n\r\n Foi feito contato com Rosa na localidade onde foi informado que não a energia eletrica.\r\n Link se encontra operante apos normalizado da energia eletrica.\r\n\r\n 0744\r\n\r\n   Foi feito contato com Celha na localidade onde foi informado que não a energia eletrica.\r\n   Link se encontra operante apos normalizado da energia eletrica.\r\n\r\n 0692\r\n\r\n   Atendimento ja realizado na ID 433817\r\n\r\n', 3, 65, 10, 142, '0751\r\n  \r\nFoi enviado técnico no local aonde foi constatado que a antena por conta da forte chuva no local no dia 29/01/2012 fez que perdesse alinhamento \r\npor causa da base que danificou.\r\n \r\n0743 \r\n\r\n Foi feito contato com Rosa na localidade onde foi informado que não a energia elétrica.\r\n Link se encontra operante após normalizado energia elétrica.\r\n\r\n 0744\r\n\r\n   Foi feito contato com celha na localidade onde foi informado que não a energia elétrica.\r\n   Link se encontra operante após normalizado energia elétrica.\r\n\r\n 0692\r\n\r\n   Atendimento já realizado na ID 433817\r\n\r\nCausas: Não e responsabilidade da Operadora.\r\n', 1),
