(166, '2012-02-01 08:14:59', 'OLIVAN = Feito contato no local as 08:19 mas não houve sucesso,  tom de ocupado.\r\n\r\nOLIVAN = Feito contato no local as 08:30 onde Bianca pediu para retorna a ligação para numero \r\n               (32) 84727672 para verificar status do modem na Farmacia.\r\n               Feito contato no numero 84727672, fora de area de corbertura.\r\n               Bianca retornou a ligação informando que o modem esta com luz de erro ligada e a \r\n               luz do trasmiter apagada, chuva forte na localidade no dia de 31/01 com queda de energia, \r\n               feito desligamento e da idu na tomada e religado link normalizado.', 2, 46, 10, 148, 'Feito contato no local onde Bianca Maria informou quedas de energia na localidade a partir do 31/01/2012 por for forte chuva deixando a IDU desligada por falta de energia elétrica causando paralisação do link.\r\n\r\nLink normalizado após estabelecimento da energia e dos equipamentos.\r\n\r\nCausa: Não  e responsabilidade da Operadora.\r\n', 2),
(167, '2012-02-01 08:23:52', 'OLIVAN= Feito contato no local as 08:25 sem sucesso, ninguem atendeu.\r\n\r\nOLIVAN= Feito Contato no local com Estela onde informou pico de energia no dia 31/01 e foi verificadno no modem que a luz do tx estava apagada e a luz de erro piscando, Foi feito desligamento da IDU na tomada . link normalizado', 2, 57, 10, 149, 'Feito contato no local onde Estela informou quedas de energia na localidade a partir do 31/01/2012 por chuva deixando a IDU desligada por falta de energia elétrica causando paralisação do link.\r\n\r\nLink normalizado após estabelecimento da energia e dos equipamentos.\r\n\r\nCausa: Não  e responsabilidade da Operadora.\r\n', 2),
