(134, '432345', 'FLAVIA TIMOTEO CONRADO[1569] - R. - <flavia.conrado@prodemge.gov.br> em 24/01/2012 11:34\r\nAPRESENTOU UMA SOLUÇÃO para a ocorrência (vide campo Solução)\r\n--------------------------------------------------\r\nFLAVIA TIMOTEO CONRADO[1569] - R. - <flavia.conrado@prodemge.gov.br> em 24/01/2012 11:35 Repasse\r\nContinuar no Fluxo, Etapa ''GAT - Nivel 2 - Atendimento'' finalizada com status : Responsabilidade da Operadora / Encaminhar Atendimento para NOC da Operadora.Entrada etapa ''NOC da Operadora / Atendimento encaminhado''. Responsável Grupo definido pela formula : Verificar o NOC da Operadora.\r\n--------------------------------------------------\r\nOLIVAN NEVES RANGEL MACHADO[1668] - R. - <noc@vodanet-telecom.com> em 24/01/2012 11:42\r\nDe acordo com a IDU as linhas de configuração snmp estão ok.\r\n\r\nfeito contato com sara no local onde foi informado pico de energia..\r\n\r\n\r\nCausa: Não e responsabilidade da operadora.\r\n--------------------------------------------------\r\nOLIVAN NEVES RANGEL MACHADO[1668] - R. - <noc@vodanet-telecom.com> em 24/01/2012 11:42\r\nAPRESENTOU UMA SOLUÇÃO para a ocorrência (vide campo Solução)\r\n--------------------------------------------------\r\nOLIVAN NEVES RANGEL MACHADO[1668] - R. - <noc@vodanet-telecom.com> em 24/01/2012 11:43 Repasse\r\nCONCLUSÃO, Etapa ''NOC da Operadora / Atendimento encaminhado'' finalizada com status : Não é respons. da Operadora/Repassar atendimento de volta para GAT - Nivel 2 - Atendimento.Entrada etapa ''GAT - Nivel 2 - Atendimento''. Responsável Grupo definido pela formula : GAT - Nivel 2 - Atendimento (Workflow Rede Governo).\r\n--------------------------------------------------\r\n[Grupo 230 - EQUIPE  ATENDENTES MONITORAMENTOS] - VALDIRENE BRITO PEDREIRA SOUZA[970] - R. - <vbrito@prodemge.gov.br> em 24/01/2012 11:46 Repasse\r\n DAR ANDAMENTO', '2012-01-24', 'Alta', 62, 138, 14),
